-- Backup de tabla transacciones
-- Fecha: 2026-01-23 20:24:02

DROP TABLE IF EXISTS `transacciones_backup`;
CREATE TABLE `transacciones_backup` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `fecha` date NOT NULL,
  `concepto` varchar(500) NOT NULL,
  `socio` varchar(50) NOT NULL,
  `cliente_id` int(11) DEFAULT NULL,
  `empresa_id` int(11) NOT NULL,
  `forma_pago` varchar(50) NOT NULL,
  `cantidad` decimal(10,2) NOT NULL,
  `precio_unitario` decimal(15,2) NOT NULL,
  `total` decimal(17,2) GENERATED ALWAYS AS ((`cantidad` * `precio_unitario`)) STORED,
  `tipo` enum('G','I') NOT NULL,
  `created_by` int(11) NOT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1524 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

